import React from 'react';
import Navbar from './Navbar';
const Header = () =>  (
    <Container fluid>
        <Row>
            <div className="header">
                <img className="my-image" src="https://live.staticflickr.com/65535/49922440751_f4f170eaeb_b.jpg"></img>
     
                <div className= "container my-name-box">
                <Navbar />
                <h1>Myat Hmu Khin</h1> 
                </div>
            </div>
        </Row>
    
    
    </Container>

);

export default Header;
